import React, { useState } from "react";
import "../App.css";
import { useNavigate } from "react-router-dom";
import axios from "axios";

const SignUp = () => {
  const navigate = useNavigate();
  const [message, setMessage] = useState("");

  const emailsaved = async (email) => {
    try {
      const result = await axios.get(
        `http://localhost:4000/api/users/getbyemail/${email}`
      );
      return result.data.length > 0;
    } catch (error) {
      console.error(error);
      return false;
    }
  };

  const validateEmail = (email) => {
    const re = /\S+@\S+\.\S+/;
    return re.test(email);
  };

  const verif = async (obj) => {
    if (obj.userName.length === 0 || obj.userName.includes("123456789")) {
      setMessage("Invalid Username");
    } else if (obj.email.length === 0 || !validateEmail(obj.email)) {
      setMessage("Invalid Email. Please enter a valid email address.");
    } else if (obj.password.length < 8) {
      setMessage(
        "Invalid Password. Please enter a password with a minimum of 8 characters."
      );
    } else if (obj.password !== obj.confirmpass) {
      setMessage("Passwords do not match");
    } else if (await emailsaved(obj.email)) {
      setMessage("Email already exists");
    } else {
      try {
        await axios.post(`http://localhost:4000/api/users/adduser`, {
          userName: obj.userName,
          email: obj.email,
          password: obj.password,
          imageUrl: obj.imageUrl,
          githubLink: obj.githubLink,
        });
        navigate("/");
      } catch (error) {
        console.error(error);
      }
    }
  };

  return (
    <form className="form">
      <p className="title">Register</p>
      <p className="message">Signup now and get full access to our app.</p>
      <div className="flex">
        <label>
          <input
            id="fName"
            required
            placeholder=""
            type="text"
            className="input"
          />
          <span>Firstname</span>
        </label>

        <label>
          <input
            id="lName"
            required
            placeholder=""
            type="text"
            className="input"
          />
          <span>Lastname</span>
        </label>
      </div>

      <label>
        <input
          id="email"
          required
          placeholder=""
          type="email"
          className="input"
        />
        <span>Email</span>
      </label>

      <label>
        <input
          id="pass"
          required
          placeholder=""
          type="password"
          className="input"
        />
        <span>Password</span>
      </label>
      <label>
        <input
          id="cpass"
          required
          placeholder=""
          type="password"
          className="input"
        />
        <span>Confirm password</span>
      </label>
      <label>
        <input
          id="img"
          required
          placeholder=""
          type="text"
          className="input"
        />
        <span>Your image Url</span>
      </label>
      <label>
        <input
          id="git"
          required
          placeholder=""
          type="text"
          className="input"
        />
        <span>Your github Link</span>
      </label>
      <p>{message}</p>
      <button
        className="submit"
        onClick={(e) => {
          e.preventDefault();
          verif({
            userName:
              document.getElementById("fName").value +
              "_" +
              document.getElementById("lName").value,
            email: document.getElementById("email").value,
            password: document.getElementById("pass").value,
            confirmpass: document.getElementById("cpass").value,
            imageUrl: document.getElementById("img").value,
            githubLink: document.getElementById("git").value,
          });
        }}
      >
        Submit
      </button>
      <p className="signin">
        Already have an account?{" "}
        <a
          onClick={() => {
            navigate("/");
          }}
        >
          LOGIN
        </a>
      </p>
    </form>
  );
};

export default SignUp;
